import Signin_signup from './Signin_signup'
import { Route, Routes as BaseRoutes } from "react-router-dom";

function App() {

  return (
    <div className="App" >
      <BaseRoutes>
      <Route path="/" element={<Signin_sign />} />
      </BaseRoutes>
    </div>
  );
}

export default App;
